svg.script:
var lines = ["Flusso_768", "Flusso_741", "Flusso_758", "Flusso_765", "Flusso_747", "Flusso_744", "Flusso_756", "Flusso_771", "Flusso_762", "Flusso_751", "Flusso_767", "Flusso_749", "Flusso_770", "Flusso_750", "Flusso_764", "Flusso_746", "Flusso_743", "Flusso_753", "Flusso_761", "Flusso_739", "Flusso_760", "Flusso_740", "Flusso_757", "Flusso_752", "Flusso_772", "Flusso_763", "Flusso_745", "Flusso_769", "Flusso_742", "Flusso_766", "Flusso_748", "Flusso_755", "Flusso_759", "Flusso_754"];
var devices = [["p-4606b", "xv4236"], ["xv4301a", "abbacidoexit"], ["e-4506", "h2otorreexit"], ["r-4003", "xv4245c"], ["s-4301start", "r-4003"], ["e-4506", "ul143"], ["p-4606b", "e-4506"], ["azotostart", "ul140"], ["xv4321b", "p-4606b"], ["ul143", "r-4003"], ["ul141", "xv4245c"], ["p-4606start", "r-4003"], ["xv4245c", "degasamentoiposodioexit"], ["ul142", "r-4003"], ["xv4235", "s4305-exit"], ["r-4003", "h20caldaexit"], ["p-4606b", "ul145"], ["xv4313", "r-4003"], ["r-4003", "xv4321b"], ["r-4003", "xv4003d"], ["clorostart", "ul144"], ["xv4003d", "gasdisingaggio-exit"], ["xv4506", "e-4506"], ["ul145", "r-4003"], ["xv4236", "s4304-exit"], ["p-4606b", "xv4235"], ["p-4606b", "ul142"], ["ul140", "ul141"], ["r-4003", "xv4301a"], ["xv4207c", "xv4245c"], ["s-4302start", "r-4003"], ["h2ocaldastart", "xv4313"], ["ul144", "xv4207c"], ["h2otorrestart", "xv4506"]];
var elementLines = [];
var elementDevices = [];
var n = [];
var nD = [];
function highlight(className, value, display) {
    document.getElementById(className.baseVal).setAttribute("display", display);
    for(var i = 0; i <  n[className.baseVal]; i ++) {
        elementLines[className.baseVal][i].setAttribute("stroke-width", value);
    }
    for(var i = 0; i < nD[className.baseVal]; i++) {
        elementDevices[className.baseVal][i].setAttribute("stroke-width", value);
    }
}
for(var i = 0; i < lines.length; i++) {
    var currentClass = lines[i];
    elementLines[currentClass] = document.getElementsByClassName(currentClass);
    n[currentClass] = elementLines[currentClass].length;
    nD[currentClass] = devices[i].length;
    elementDevices[currentClass] = [];
    for(var j = 0; j < nD[currentClass]; j++) {
        elementDevices[currentClass][j] = document.getElementById(devices[i][j]);
    }
    for(var k = 0; k < n[currentClass]; k++) {
        elementLines[currentClass][k].onmouseover = function() {
            highlight(this.className, "7", "block");
        };
        elementLines[currentClass][k].onmouseout = function() {
            highlight(this.className, "3", "none");
        };
    }
};
